INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1115003, "デストラクション", 111500302, 0, 0, 0.0, 111500305, 0, "コインを持っていない場合、目の前の敵１キャラに物理中ダメージを与える。コインを持っている場合、目の前の敵１キャラに物理中ダメージを与え、さらに味方全体のＴＰ上昇を小アップする。", 0, 0, 111500306, 111500304, 0, 0, 0, 0, 111500301, 2001, 0, 0.58, 0, 0, 0, 0, 1, 111500303);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1115012, "エンハンスプレゼント+", 111501202, 0, 0, 0.0, 111501205, 0, "コインを持っていない場合、物理攻撃を行うすべての味方キャラの物理攻撃力を特大アップさせる。コインを持っている場合、物理攻撃を行うすべての味方キャラの物理攻撃力を大アップさせる。さらに、自分の物理攻撃力を特大アップさせ、物理攻撃クリティカル時のダメージを中アップさせる。", 0, 0, 111501206, 111501204, 0, 0, 0, 0, 111501201, 2003, 111501207, 0.34, 0, 0, 0, 0, 0, 111501203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1115013, "デストラクション+", 111501302, 111501308, 0, 0.0, 111501305, 0, "短時間全ての物理攻撃を回避する状態になり、コインを持っていない場合、目の前の敵１キャラに物理大ダメージを与える。コインを持っている場合、目の前の敵１キャラに物理大ダメージを与え、味方全体のＴＰ上昇を小アップさせる。さらにコインの有無にかかわらず、バトル終了時まで全てのスキルでコインを持っていない場合とコインを持っている場合の効果が両方発動する状態になる。この状態の間、デストラクション+に自分を中心とした範囲内の味方の行動速度を大アップさせる効果が追加される。", 0, 111501310, 111501306, 111501304, 0, 0, 0, 0, 111501301, 2001, 111501307, 0.58, 0, 0, 111501309, 0, 1, 111501303);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1115100, "デュアリティアヴァロン", 111510002, 0, 0, 0.0, 0, 0, "目の前の敵１キャラに物理特大ダメージを与え、自分の物理攻撃力を特大アップする。その後、コインを消費して必ず命中する物理特大ダメージを与える。", 0, 0, 0, 111510004, 0, 0, 0, 0, 111510001, 1001, 0, 0.0, 0, 0, 0, 0, 1, 111510003);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1115101, "エンハンスプレゼント+", 111510102, 0, 0, 0.0, 0, 0, "物理攻撃を行うすべての味方キャラの物理攻撃力を特大アップさせる。さらに、物理攻撃を行うすべての味方キャラの物理攻撃力を大アップさせ、自分の物理攻撃力を特大アップし、物理攻撃クリティカル時のダメージを中アップする。", 0, 0, 0, 111510104, 0, 0, 0, 0, 111510101, 2003, 0, 0.34, 0, 0, 0, 0, 0, 111510103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1115102, "デストラクション+", 111510202, 0, 0, 0.0, 111510205, 0, "一定時間全ての物理攻撃を回避する状態になり、目の前の敵１キャラに物理大ダメージを２回与え、味方全体のＴＰ上昇を小アップさせる。さらに自分を中心とした範囲内の味方の行動速度を大アップさせる。", 0, 0, 111510206, 111510204, 0, 0, 0, 0, 111510201, 2001, 0, 0.58, 0, 0, 0, 0, 1, 111510203);
