INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1220002, "ソウルバインド", 122000202, 0, 0, 0.0, 0, 0, "目の前の敵１キャラに物理中ダメージを与え、物理防御力を小ダウンさせる。さらに、【霊錨の刻印】を２つ追加で付与する。", 0, 0, 0, 0, 0, 0, 0, 0, 122000201, 2001, 0, 0.525, 122000201, 0, 0, 0, 0, 122000203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1220003, "ボイドスラッシュ", 122000302, 0, 0, 0.0, 122000305, 0, "目の前の敵１キャラに物理中ダメージを与え、自分の物理攻撃力を小アップ、ＴＰを小回復させる。対象の敵に【霊錨の刻印】が付与されている場合、【霊錨の刻印】の数に応じて最大３つ分まで物理攻撃力の上昇量とＴＰの回復量をアップさせ、【霊錨の刻印】を３つ消費する。", 0, 0, 122000306, 122000304, 0, 0, 0, 0, 122000301, 2001, 0, 0.525, 0, 0, 0, 0, 0, 122000303);
