INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1222001, "キャンピングライムライト", 122200102, 0, 0, 0.0, 122200105, 0, "目の前の敵に物理特大ダメージを与える。このスキルがクリティカルした場合のダメージは２倍ではなく３倍になる。【至福のひと時】が３以上の場合、味方全体の物理攻撃力を小アップし物理クリティカルを大アップする。このスキルのクリティカルした場合のダメージと物理攻撃力と物理クリティカルの上昇量は【至福のひと時】に応じて増加する。", 0, 0, 122200106, 122200104, 0, 0, 0, 0, 122200101, 1001, 122200107, 0.0, 0, 0, 0, 122200104, 0, 122200103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1222002, "ラスティネイル", 122200202, 0, 0, 0.0, 0, 0, "前方範囲内のランダムな敵キャラに単体物理小ダメージを与える。【至福のひと時】が３以上の場合、このスキルによるダメージが上昇しクリティカルした場合のダメージは、２倍ではなく３倍になり、【至福のひと時】に応じてクリティカルした場合のダメージが増加する。", 0, 0, 0, 122200204, 0, 0, 0, 0, 122200201, 2001, 0, 0.85, 0, 0, 0, 0, 0, 122200203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1222003, "グリルパラダイス", 122200302, 0, 0, 0.0, 122200305, 0, "自分に【至福のひと時】を１つ追加して、ＴＰを中回復し、物理攻撃力を中アップする。【至福のひと時】は最大７まで追加される。さらに【至福のひと時】が３未満の場合、自分以外のＴＰが低い味方２キャラのＴＰを中回復させ、【至福のひと時】が３以上の場合は、自分以外のＴＰが低い味方３キャラのＴＰを中回復させ、物理攻撃力を中アップする。", 0, 0, 122200306, 122200304, 0, 0, 0, 122200305, 122200301, 2003, 122200307, 0.59, 0, 0, 0, 0, 0, 122200303);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1222012, "ラスティネイル+", 122201202, 0, 0, 0.0, 122201205, 0, "前方範囲内のランダムな敵１キャラに物理中ダメージを与える。【至福のひと時】が３以上の場合、ダメージが上昇しクリティカルした場合のダメージは、２倍ではなく３倍になる。さらに【至福のひと時】に応じてこのスキルがクリティカルした場合のダメージが増加する。【至福のひと時】が６以上の場合、前方範囲内のランダムな敵１キャラにクリティカルした場合のダメージが２倍ではなく４倍になる追加の物理大ダメージを与える。", 0, 0, 122201206, 122201204, 0, 0, 0, 0, 122201201, 2001, 122201207, 0.85, 0, 0, 0, 0, 0, 122201203);
