INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1225003, "アズールショット", 122500302, 0, 0, 0.0, 0, 122500303, "目の前の敵１キャラに物理中ダメージを与え、クリティカルを受けた際のダメージを小アップさせる。このスキルのダメージは、【水刃の加護】の数に応じて増加する。【水刃の加護】を１つ消費する。", 0, 0, 0, 122500304, 0, 0, 0, 0, 122500301, 2001, 0, 0.59, 0, 0, 0, 0, 0, 122500303);
