INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1290003, "アンドレイア", 129000302, 0, 0, 0.0, 129000305, 0, "味方全体の物理攻撃力と魔法攻撃力を大アップさせ、クリティカル時のダメージを小アップさせる。攻撃力の上昇量は自分の残りＨＰに応じて最大５倍までアップする。", 0, 0, 129000306, 129000304, 0, 0, 0, 0, 129000301, 2003, 0, 1.6, 0, 0, 0, 0, 0, 129000303);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1290101, "アタナシア", 0, 0, 0, 0.0, 0, 0, "味方全体に回帰の薔薇を付与する。回帰の薔薇付与時にＨＰが０になると、倒れずに回帰の薔薇を消費してＨＰを回復する。", 0, 0, 0, 0, 0, 0, 0, 0, 129010101, 2017, 0, 1.6, 0, 0, 0, 0, 0, 0);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1290501, "プレネーシス", 0, 0, 0, 0.0, 0, 0, "バトル開始時に自分の最大ＨＰを中アップさせる。", 0, 0, 0, 0, 0, 0, 0, 0, 129050101, 3005, 0, 0.0, 0, 0, 0, 0, 0, 0);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1290511, "プレネーシス+", 0, 0, 0, 0.0, 0, 0, "バトル開始時に自分の最大ＨＰを大アップさせる。", 0, 0, 0, 0, 0, 0, 0, 0, 129051101, 3005, 0, 0.0, 0, 0, 0, 0, 0, 0);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1293001, "実践と観想の黄金律", 129300102, 0, 0, 0.0, 129300105, 0, "味方全体の物理攻撃力を特大アップ、物理クリティカルを大アップし、物理攻撃クリティカル時のダメージを小アップさせ、ＨＰを中回復させる。さらに自分に【水際の安寧】を３つ付与する。【水際の安寧】は１回ダメージを受けると１つ減少する。【水際の安寧】は最大３まで追加される。", 0, 0, 0, 129300104, 0, 0, 0, 0, 129300101, 1003, 0, 0.0, 0, 0, 0, 0, 0, 129300103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1293002, "功利的認識共有", 129300202, 0, 0, 0.0, 129300205, 0, "味方全体の物理攻撃力を特大アップし、行動速度を大アップさせる。自分に【水際の安寧】が付与されている場合、行動速度の上昇量がアップし、さらに、味方全体の物理攻撃力と物理クリティカルを大アップする。", 0, 0, 129300206, 129300204, 0, 0, 129300204, 0, 129300201, 2003, 0, 1.05, 0, 0, 0, 129300204, 0, 129300203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1293003, "生態的究明理論", 129300302, 0, 0, 0.0, 129300305, 0, "味方全体の物理攻撃力を特大アップ、物理攻撃クリティカル時のダメージを小アップさせ、自分を中心とした範囲内の味方すべてのＨＰを小回復するフィールドを展開する。【水際の安寧】が付与されている場合、さらに、味方全体の物理攻撃力を大アップ、ＴＰ上昇を小アップさせる。", 0, 0, 129300306, 129300304, 0, 0, 0, 0, 129300301, 2003, 0, 1.05, 0, 0, 0, 129300305, 0, 129300303);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1293012, "功利的認識共有+", 129301202, 129301208, 0, 0.0, 129301205, 0, "味方全体の物理攻撃力を特大アップし、行動速度を大アップさせる。自分に【水際の安寧】が付与されている場合、行動速度の上昇量がアップし、さらに、味方全体の物理攻撃力を特大アップ、物理クリティカルを大アップ、物理攻撃クリティカル時のダメージを小アップさせ、自分のＴＰを中回復する。", 0, 0, 129301206, 129301204, 0, 0, 129301204, 129301204, 129301201, 2003, 129301207, 1.05, 0, 0, 129301209, 129301204, 0, 129301203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1293101, "トルネード物理スプラッシュ", 129310102, 0, 0, 0.0, 0, 0, "味方全体の物理攻撃力を大アップし、自分のＴＰを小回復する。自分に【水際の安寧】が付与されている場合、目の前の敵１キャラに物理極小ダメージを与える。", 0, 0, 0, 129310104, 0, 0, 0, 0, 129310101, 2003, 0, 2.04, 0, 0, 0, 0, 0, 129310103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1293501, "奈落の悟り", 0, 0, 0, 0.0, 0, 0, "バトル開始時に自分の物理攻撃力を中アップさせる。", 0, 0, 0, 0, 0, 0, 0, 0, 129350101, 3001, 0, 0.0, 0, 0, 0, 0, 0, 0);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1293511, "奈落の悟り+", 0, 0, 0, 0.0, 0, 0, "バトル開始時に自分の物理攻撃力を大アップさせる。", 0, 0, 0, 0, 0, 0, 0, 0, 129351101, 3001, 0, 0.0, 0, 0, 0, 0, 0, 0);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1294001, "白銀の熱天", 129400102, 129400108, 0, 0.0, 129400105, 0, "目の前の敵１キャラに物理大ダメージを与え、自分の物理攻撃力を特大アップする。対象の【水月】が一定以上の場合、このスキルのダメージが段階的に増加する。対象の【水月】が99の場合、【水月】を33消費し、目の前の敵１キャラに追加の物理特大ダメージを与える。", 0, 129400110, 129400106, 129400104, 0, 0, 0, 0, 129400101, 1001, 129400107, 0.0, 0, 0, 129400109, 0, 0, 129400103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1294002, "無風の航路", 129400202, 129400208, 0, 0.0, 129400205, 0, "目の前の敵１キャラに物理大ダメージを与え、物理防御力を中ダウンさせる。対象の【水月】が一定以上の場合、このスキルのダメージ、ヒット数、防御力の減少量が段階的に増加する。", 129400202, 0, 129400206, 129400204, 0, 0, 0, 0, 129400201, 2001, 129400207, 1.05, 0, 129400207, 0, 129400205, 0, 129400203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1294003, "行潦の飛沫", 129400302, 129400308, 0, 0.0, 129400305, 0, "目の前の敵１キャラに物理大ダメージを与え、味方全体の物理攻撃力を中アップする。対象の【水月】が一定以上の場合、このスキルのダメージ、ヒット数、物理攻撃力の上昇量が段階的に増加する。", 0, 129400310, 129400306, 129400304, 0, 0, 0, 0, 129400301, 2001, 129400307, 1.05, 0, 0, 129400309, 0, 0, 129400303);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1294012, "無風の航路+", 129401202, 129401208, 129401202, 0.0, 129401205, 0, "目の前の敵１キャラに物理大ダメージを与え、物理防御力を中ダウンさせる。対象の【水月】が一定以上の場合、このスキルのダメージ、ヒット数、防御力の減少量が段階的に増加する。さらに対象の【水月】が66以上の場合、クリティカルを受けた際のダメージを小アップさせる。", 129401202, 0, 129401206, 129401204, 0, 0, 0, 0, 129401201, 2001, 129401207, 1.05, 0, 129401207, 129401209, 129401205, 0, 129401203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1294101, "水鏡の淡月", 129410102, 0, 0, 0.0, 0, 0, "敵全体の物理防御力を小ダウンさせる。さらに味方全体が【水月】を敵へ付与できる状態になる。攻撃が敵に当たるたび【水月】を１つ付与する。【水月】は最大99まで追加される。", 0, 0, 0, 0, 0, 0, 0, 0, 129410101, 2004, 0, 2.04, 0, 0, 0, 0, 0, 0);
