INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1294511, "巻き立つ波+", 0, 0, 0, 0.0, 0, 0, "バトル開始時に自分の物理攻撃力を大アップさせる。", 0, 0, 0, 0, 0, 0, 0, 0, 129451101, 3001, 0, 0.0, 0, 0, 0, 0, 0, 0);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1295001, "ちぇるちぇる☆すぷらっしゅ", 129500102, 129500108, 0, 0.0, 129500105, 0, "味方全体の物理攻撃力を特大アップ、物理無効バリアと魔法無効バリアを展開し、目の前の敵１キャラに物理特大ダメージを２回与える。このダメージは【ちぇる】の数に応じて最大30個分まで増加する。【ちぇる】が30以上の時、味方全体の物理攻撃力を特大アップ、物理クリダメを小アップさせる。", 0, 129500110, 129500106, 129500104, 0, 129500109, 0, 0, 129500101, 1001, 129500107, 0.0, 0, 0, 129500109, 0, 0, 129500103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1295002, "ちぇるすぺ☆うぃんどみる", 129500202, 0, 0, 0.0, 129500205, 0, "目の前の敵１キャラに物理大ダメージを与え、味方全体の物理攻撃力を大アップさせる。このダメージは【ちぇる】の数に応じて最大30個分まで増加する。【ちぇる】が30以上の時、追加で味方全体の物理攻撃力と物理クリティカルを大アップさせる。", 0, 0, 129500206, 129500204, 0, 0, 0, 0, 129500201, 2003, 129500207, 1.05, 0, 0, 0, 0, 0, 129500203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1295003, "ちぇるりぞ☆えくそだす", 129500302, 129500308, 0, 0.0, 129500305, 0, "味方全体の物理攻撃力を大アップ、ＴＰ上昇を小アップさせる。【ちぇる】が30以上の時、味方全体のＴＰを中回復させる。【ちぇる】が60の時、【ちぇる】を30消費して、ＴＰの回復量が大幅にアップする。", 0, 0, 129500306, 129500304, 0, 0, 0, 0, 129500301, 2003, 129500307, 1.05, 0, 0, 0, 0, 0, 129500303);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1295101, "ちぇるりぞ☆えくそだす", 129510102, 0, 0, 0.0, 0, 0, "自分がステータスアップ効果を受ける度に、【ちぇる】が１つ追加される状態にする。【ちぇる】は最大60まで追加される。味方全体の物理攻撃力を大アップ、ＴＰ上昇を小アップさせる。", 0, 0, 0, 0, 0, 0, 0, 0, 129510101, 2003, 0, 1.05, 0, 0, 0, 0, 0, 129510103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1295501, "春夏秋冬☆ちぇるんな子", 0, 0, 0, 0.0, 0, 0, "バトル開始時に自分の物理攻撃力を中アップさせる。", 0, 0, 0, 0, 0, 0, 0, 0, 129550101, 3001, 0, 0.0, 0, 0, 0, 0, 0, 0);
