INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1296001, "ヴィヴィッド・ヴィジランス", 129600102, 129600108, 129600110, 0.0, 129600105, 0, "【拒絶の花】を展開する。【拒絶の花】展開中、敵の物理・魔法防御力を中ダウンさせ、物理と魔法攻撃力を合わせた継続物理ダメージを与える。対象の魔法防御力が物理防御力より低い場合、魔法ダメージ扱いになる。さらに、味方の物理・魔法防御力を中アップさせ、ＨＰを継続回復する。このＨＰ回復量は、物理と魔法攻撃力に応じて増加する。", 0, 129600110, 129600106, 129600104, 0, 129600109, 0, 0, 129600101, 1017, 129600107, 0.0, 0, 0, 129600109, 0, 0, 129600103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1296002, "アイヴィドレイン", 129600202, 0, 0, 0.0, 129600205, 129600202, "目の前の敵１キャラのＴＰを小ダウンさせ、最もＨＰの低い味方１キャラを中心とした範囲内の味方すべてのＨＰとＴＰを小回復する。このスキルのＨＰ回復量は、このキャラの物理と魔法攻撃力に応じて増加する。", 0, 0, 0, 129600204, 0, 0, 129600202, 0, 129600201, 2006, 0, 1.05, 0, 0, 0, 0, 0, 129600203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1296003, "ポイズンフリック", 129600302, 0, 0, 0.0, 129600305, 0, "敵全体の物理攻撃力と魔法攻撃力を大ダウン、物理防御力、魔法防御力、物理攻撃のダメージ、魔法攻撃のダメージを小ダウンさせる。", 0, 0, 129600306, 129600304, 0, 0, 0, 0, 129600301, 2004, 129600307, 1.05, 0, 0, 0, 0, 0, 129600303);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1296101, "フラワートリック", 129610102, 0, 0, 0.0, 0, 0, "自分の行動速度を大アップさせ、空蝉状態になり、ＴＰを小回復する。空蝉状態は受けるダメージを１回無効化し、その後解除される。（このスキルの効果は他の行動速度変化スキルと重複する）", 0, 0, 0, 129610104, 0, 0, 0, 0, 129610101, 2017, 0, 1.05, 0, 0, 0, 0, 0, 129610103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1296501, "ワイルドグロース", 0, 0, 0, 0.0, 0, 0, "バトル開始時に自分の最大ＨＰを中アップさせる。", 0, 0, 0, 0, 0, 0, 0, 0, 129650101, 3005, 0, 0.0, 0, 0, 0, 0, 0, 0);
