INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1297001, "滅裂万化・輪廻転掌", 129700102, 0, 0, 0.0, 129700105, 129700102, "最も物理防御力の低い敵１キャラに物理特大ダメージを与え、物理防御力を小ダウンさせ、クリティカルを受けた際のダメージを小アップさせる。【妨魔塵】中、このスキルの効果がアップする。", 0, 0, 129700106, 129700104, 0, 0, 129700103, 129700103, 129700101, 1001, 129700107, 0.0, 0, 0, 0, 129700102, 0, 129700103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1297002, "万化・硬拳", 129700202, 129700208, 129700205, 0.0, 129700205, 0, "最も物理防御力の低い敵１キャラに物理中ダメージを与え、味方全体の物理攻撃力を大アップ、物理クリティカルを中アップ、物理攻撃クリティカル時のダメージを小アップさせる。【妨魔塵】中、このスキルの効果がアップする。", 0, 129700210, 129700206, 129700204, 0, 129700206, 0, 129700205, 129700201, 2001, 129700207, 1.05, 0, 129700206, 129700209, 0, 0, 129700203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1297003, "万化・蛇盾", 129700302, 129700308, 0, 0.0, 129700305, 0, "味方全体の行動速度を大アップ、ＨＰを中回復する。バトル開始後、初弾のこのスキルは自分に【鉄気ノ護リ】を20追加し、付与されている間、味方全員が敵から受けるダメージを10％軽減する。味方が敵からダメージを受ける度、【鉄気ノ護リ】を１つ消費し、その敵の最大ＨＰに応じて最大99999の割合ダメージを与え、味方全体の物理攻撃力を中アップする。【妨魔塵】中、行動速度の上昇量がアップする。", 0, 0, 129700306, 129700304, 0, 0, 0, 0, 129700301, 2017, 129700307, 1.05, 0, 0, 129700309, 0, 0, 129700303);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1297101, "欺魔・鉄霞", 129710102, 0, 0, 0.0, 0, 0, "環境効果【妨魔塵】を発動する。このスキルの効果は敵、味方すべてに適用される。魔法攻撃で与えるダメージが小ダウンする。", 0, 0, 0, 0, 0, 0, 0, 0, 129710101, 2017, 0, 1.05, 129710101, 0, 0, 0, 0, 0);
