INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1299003, "ヘヴィコマンド", 129900302, 129900308, 0, 0.0, 129900305, 0, "味方全体の物理攻撃力と物理クリティカルを大アップさせ、物理防御力と魔法防御力を小アップさせる。さらに自分のＴＰを大回復し、自分以外の味方すべてのＴＰを小回復する。味方の人数に応じて物理攻撃力と物理クリティカルの上昇量が最大７キャラ分までアップする。", 0, 0, 129900306, 129900304, 0, 0, 0, 0, 129900301, 2003, 129900307, 0.66, 0, 0, 0, 0, 0, 129900303);
