INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1300001, "ティース・ワインディング", 130000102, 0, 0, 0.0, 0, 0, "敵全体の物理防御力を小ダウンさせ、クリティカルを受けた際のダメージを小アップさせ、前方範囲内の敵すべてに物理大ダメージを与える。さらに、自分のＨＰを中回復する。このスキルのダメージは、１ヒットは必ずクリティカルする。", 0, 0, 0, 130000104, 0, 0, 0, 0, 130000101, 1001, 0, 0.0, 0, 0, 0, 0, 0, 130000103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1300002, "チェーンエッジ", 130000202, 0, 0, 0.0, 0, 0, "前方範囲内の敵すべてに物理中ダメージを２回与え、物理防御力を小ダウンさせる。さらに、自分のＨＰを中回復する。", 130000202, 0, 0, 130000204, 0, 0, 0, 0, 130000201, 2001, 0, 1.05, 0, 0, 0, 0, 0, 130000203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1300003, "バンディットダイス", 130000302, 130000308, 0, 0.0, 130000305, 130000301, "自分の物理攻撃力を大アップ、物理攻撃クリティカル時のダメージを小アップさせる。さらに、【バンディダイス】をすべて消費するが、消費した【バンディダイス】の数に応じて効果量がアップする。【バンディダイス】を８つ消費した場合、効果量の上昇量と効果時間が増加する。", 0, 0, 130000306, 130000304, 0, 0, 130000304, 130000306, 130000301, 2003, 130000307, 1.05, 0, 0, 0, 130000301, 0, 130000303);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1300101, "水分補給だよ", 130010102, 0, 0, 0.0, 130010105, 0, "自分の物理防御力と魔法防御力を大アップする。さらに、自分を敵にクリティカルでダメージを与えるたびに【バンディダイス】が１つ追加される状態にし、自分に【バンディダイス】を３つ付与する。【バンディダイス】は最大８つまで追加される。", 0, 0, 0, 130010104, 0, 0, 0, 0, 130010101, 2017, 0, 1.05, 0, 0, 0, 0, 0, 130010103);
