INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1301001, "お願い！スパイクブラザーズ", 130100102, 130100108, 0, 0.0, 130100105, 0, "【召喚】味方全体の物理攻撃力を特大アップさせ、目の前の敵１キャラに物理特大ダメージを与え、物理防御力を小ダウンさせる。さらにワカナが呼び出したスパイクブラザーズが味方にいる場合、スパイクブラザーズのＨＰを大回復し、そうでない場合スパイクブラザーズを１体呼び出す。", 130100102, 0, 130100106, 130100104, 0, 0, 0, 0, 130100101, 1003, 130100107, 0.0, 0, 0, 0, 0, 0, 130100103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1301002, "カレー、いかがです？", 130100202, 130100208, 0, 0.0, 130100205, 0, "自分以外の味方全体の物理攻撃力と物理クリティカルを特大アップさせ、ＨＰとＴＰを中回復させる。さらに、自分の物理攻撃力を中アップ、物理クリティカルを大アップし、ＨＰとＴＰを小回復する。", 0, 0, 130100206, 130100204, 0, 0, 0, 0, 130100201, 2003, 130100207, 1.05, 0, 0, 0, 0, 0, 130100203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1301003, "スパイクラッシュ", 130100302, 0, 0, 0.0, 0, 0, "目の前の敵１キャラに物理大ダメージを与え、味方全体に物理/魔法無効バリアを展開する。", 0, 0, 0, 0, 0, 0, 0, 0, 130100301, 2013, 0, 0.66, 0, 0, 0, 0, 0, 0);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1301101, "誰か助けて～！", 130110102, 0, 0, 0.0, 0, 0, "【召喚】ワカナが呼び出したスパイクブラザーズが味方にいない場合、スパイクブラザーズを１体呼び出す。スパイクブラザーズは召喚後、ワカナに【スパイクガード】を付与し、敵から攻撃を受けるたび、その敵の最大ＨＰに応じて最大99999の割合ダメージを与える状態になる。さらに次の行動から、スパイクブラザーズがスキルを発動した後、一定時間【スパイクガード】が付与されているキャラへの敵の攻撃を代わりに受ける。", 0, 0, 0, 130110104, 0, 0, 0, 0, 130110101, 2017, 0, 0.0, 0, 0, 0, 0, 0, 130110103);
