INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1302001, "しんじゃえ♡フルバースト", 130200102, 130200108, 0, 0.0, 130200105, 0, "自分の物理攻撃力を特大アップさせる。さらに目の前の敵１キャラを中心とした範囲内の敵すべてに物理大ダメージを与え、物理防御力を中ダウンさせ、スタンさせる。ＨＰが最大の場合、このスキルのダメージがアップし、追加で最も物理防御力の低い敵１キャラに物理特大ダメージを与える。", 0, 130200110, 130200106, 130200104, 0, 0, 130200104, 130200105, 130200101, 1001, 130200107, 0.0, 0, 0, 130200109, 130200105, 0, 130200103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1302002, "かばって♡味方シールド", 130200202, 0, 0, 0.0, 130200205, 0, "前方の自分以外の一番前の味方１キャラに【味方バリアー♡】を付与する。【味方バリアー♡】が付与されている間、自分への攻撃を【味方バリアー♡】が付与されている味方１キャラが代わりに受ける。さらに自分の物理攻撃力と物理クリティカルを大アップ、物理攻撃クリティカル時のダメージを小アップして、ＨＰを中回復、ＴＰを小回復する。", 0, 0, 130200206, 130200204, 0, 0, 0, 0, 130200201, 2003, 0, 1.05, 0, 0, 0, 0, 0, 130200203);
