INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1309001, "グランドリームパレード", 130900102, 130900108, 130900108, 0.0, 130900105, 0, "前方の敵すべてに魔法大ダメージを与え、自分のＨＰを中回復し、無敵状態になる。このスキルのダメージは【かばばん君】の数に応じて増加し、クリティカル時のダメージが３倍になる。【かばばん君】が20以上の場合、このスキルは必ずクリティカルし、40の場合、さらに、味方全体の魔法攻撃クリティカル時のダメージを小アップする。", 0, 130900110, 130900106, 130900104, 0, 0, 0, 0, 130900101, 1002, 130900107, 0.0, 0, 130900103, 130900109, 0, 0, 130900103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1309002, "かばばん君警備員モード", 130900202, 0, 0, 0.0, 130900205, 0, "目の前の敵１キャラを中心とした範囲内の敵すべてに魔法中ダメージを与え、自分のＨＰを小回復させ、さらに物理/魔法吸収バリアを展開する。このスキルのダメージは【かばばん君】の数に応じて増加する。", 130900202, 0, 0, 130900204, 0, 0, 0, 0, 130900201, 2002, 0, 1.05, 0, 0, 0, 0, 0, 130900203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1309003, "恩返しですっ！", 130900302, 0, 0, 0.0, 130900305, 0, "自分の物理防御力と魔法防御力を中アップさせる。さらに、自分がステータスアップ効果を受ける度に、【かばばん君】を１体追加し、自分以外の味方すべての魔法攻撃力を小アップさせる。この効果は【かばばん君】が40より少ない場合に発動し、このスキルによって他のスキルの効果は発動しない。", 0, 0, 130900306, 130900304, 0, 0, 0, 0, 130900301, 2003, 0, 1.05, 0, 0, 0, 0, 0, 130900303);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1309012, "かばばん君警備員モード+", 130901202, 130901208, 0, 0.0, 130901205, 0, "目の前の敵１キャラを中心とした範囲内の敵すべてに魔法中ダメージを与え、自分のＨＰを小回復し、物理/魔法吸収バリアを展開する。このスキルのダメージは【かばばん君】の数に応じて増加し、クリティカル時のダメージが３倍になる。【かばばん君】が20以上の場合、このスキルは必ずクリティカルし、40の場合、さらにダメージを与えた敵を束縛する。", 0, 130901210, 130901206, 130901204, 0, 0, 130901203, 0, 130901201, 2002, 130901207, 1.05, 0, 130901206, 130901209, 130901203, 0, 130901203);
