INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1310001, "メルヘンカーテンコール", 131000102, 0, 0, 0.0, 131000105, 0, "前方範囲内の敵すべての魔法防御力を小ダウンさせる。さらに、味方全体の魔法攻撃力を特大アップ、魔法クリティカルを大アップさせ、自分の魔法攻撃クリティカル時のダメージを小アップさせて、【カーテンコール】を付与する。", 0, 0, 0, 131000104, 0, 0, 0, 0, 131000101, 1003, 0, 0.0, 0, 0, 0, 0, 0, 131000103);
