INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1318001, "ドラゴンズコール", 131800102, 131800108, 0, 0.0, 131800105, 131800102, "最も魔法防御力の低い敵１キャラに魔法大ダメージを与え、魔法防御力を中ダウン、クリティカルを受けた際のダメージを小アップさせる。対象の【日食】の数が25以上の場合、その敵を中心とした範囲内の敵すべてに魔法大ダメージを与える。最も魔法防御力の低い敵１キャラの【日食】の数に応じてこのスキルのダメージがアップする。", 131800102, 0, 131800106, 131800104, 0, 0, 0, 131800106, 131800101, 1002, 131800107, 0.0, 0, 0, 0, 0, 0, 131800103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1318002, "アクアスプラッシュ", 131800202, 131800208, 0, 0.0, 131800205, 0, "最も魔法防御力の低い敵１キャラに魔法大ダメージを与え、魔法防御力を小ダウンさせる。対象の【日食】の数が25以上の場合、その敵を中心とした範囲内の敵すべてに魔法中ダメージを与え、自分の魔法攻撃力を大アップ、ＴＰを小回復する。最も魔法防御力の低い敵１キャラの【日食】の数に応じてこのスキルのダメージがアップする。", 131800202, 131800210, 131800206, 131800204, 0, 131800209, 0, 0, 131800201, 2002, 131800207, 0.74, 0, 0, 131800209, 131800205, 0, 131800203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1318003, "サマーサンダーボルト", 131800302, 0, 0, 0.0, 131800305, 0, "敵全体の魔法攻撃力を大ダウン、魔法防御力を小ダウンさせる。さらに自分のＴＰを中回復する。最も魔法防御力の低い敵１キャラの【日食】の数が25以上の場合、敵全体のクリティカルを受けた際のダメージを小アップさせる。", 0, 0, 0, 131800304, 0, 0, 0, 0, 131800301, 2004, 0, 1.05, 0, 0, 0, 0, 0, 131800303);
