INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1321101, "逆巻く鉄球", 132110102, 0, 0, 0.0, 132110105, 0, "目の前の敵１キャラに物理特大ダメージを与え、自分のＴＰを中回復する。さらに、自分以外の味方全員に最大ＨＰに応じた物理割合ダメージを与える。このスキルのダメージは、【狂騒】の数に応じて増加する。このスキルによる味方へのダメージでは味方のＴＰは回復しない。", 0, 0, 0, 132110104, 0, 0, 0, 0, 132110101, 2001, 0, 1.05, 0, 0, 0, 0, 0, 132110103);
