INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1322001, "アルケミー・オンステージ", 132200102, 132200108, 0, 0.0, 132200105, 132200103, "味方全体の魔法攻撃力と魔法クリティカルを特大アップし、目の前の敵１キャラに魔法特大ダメージを与え、魔法防御力を小ダウンする。【錬金素材】を３つ以上所持している場合、３つ消費して自分の魔法攻撃力を特大アップし、【パフューム】を１つ獲得する。【パフューム】は最大４まで獲得できる。", 0, 132200110, 132200106, 132200104, 0, 0, 0, 0, 132200101, 1002, 132200107, 0.0, 0, 0, 132200109, 0, 0, 132200103);
