INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1323003, "アクシリウム", 132300302, 0, 0, 0.0, 132300305, 0, "味方全体の魔法攻撃力を特大アップ、魔法防御力を大アップ、調和状態を付与し、ＨＰとＴＰを小回復させる。調和状態の間は物理防御力と魔法防御力のうち高い方によって計算されたダメージを受ける。", 0, 0, 0, 132300304, 0, 0, 0, 0, 132300301, 2017, 0, 0.59, 0, 0, 0, 0, 0, 132300303);
