INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1325001, "アムニス・オケアノス", 132500102, 0, 0, 0.0, 132500105, 0, "敵全体の魔法防御力を特大ダウンさせ、魔法大ダメージを与える。最も魔法防御力の低い敵１キャラの【虚脱】の数が80の場合、味方全体の魔法攻撃力を極大アップ、魔法攻撃クリティカル時のダメージを小アップさせ、最も魔法防御力の低い敵１キャラに追加の魔法特大ダメージを与える。", 0, 0, 132500106, 132500104, 0, 0, 132500104, 0, 132500101, 1004, 132500107, 0.0, 0, 0, 0, 0, 0, 132500103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1325002, "アダルトメランコリー", 132500202, 0, 0, 0.0, 132500205, 0, "敵全体の魔法防御力を中ダウン、ＴＰ上昇を小ダウン、ＴＰを大ダウンさせる。最も魔法防御力の低い敵１キャラの【虚脱】の数が80の場合、味方全体の魔法攻撃力を特大アップ、ＴＰ上昇を小アップ、ＴＰを中回復させる。", 0, 0, 132500206, 132500204, 0, 0, 0, 132500205, 132500201, 2004, 132500207, 1.05, 0, 0, 0, 132500205, 0, 132500203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1325003, "アルケス印の秘薬", 132500302, 0, 0, 0.0, 132500305, 0, "敵全体の物理攻撃力と魔法攻撃力を中ダウン、魔法防御力を小ダウンさせる。バトル開始後、初弾のこのスキルは、敵全体をステータスダウンを受ける度に、【虚脱】が１つ追加される状態にする。【虚脱】は最大80まで追加される。", 0, 0, 132500306, 132500304, 0, 0, 0, 0, 132500301, 2017, 0, 1.05, 0, 0, 0, 0, 0, 132500303);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1325501, "定時退勤の心得", 0, 0, 0, 0.0, 0, 0, "バトル開始時に自分の魔法攻撃力を中アップさせる。", 0, 0, 0, 0, 0, 0, 0, 0, 132550101, 3003, 0, 0.0, 0, 0, 0, 0, 0, 0);
