INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1328001, "寵雷夜天", 132800102, 0, 0, 0.0, 132800105, 0, "目の前の敵１キャラに魔法特大ダメージを与える。自分にバリアが展開されている場合、このスキルのダメージがアップし、追加の魔法特大ダメージを与え、さらに味方全体の魔法攻撃力を特大アップさせる。", 0, 0, 132800106, 132800104, 0, 0, 0, 0, 132800101, 1002, 132800107, 0.0, 0, 0, 0, 0, 0, 132800103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1328002, "衝雷の投吻", 132800202, 0, 0, 0.0, 132800205, 132800202, "目の前の敵１キャラに魔法中ダメージを与え、魔法防御力を小ダウンさせる。自分にバリアが展開されている場合、このスキルのダメージがアップし、さらに追加の魔法大ダメージを与える。", 0, 0, 132800206, 132800204, 0, 0, 132800203, 0, 132800201, 2002, 0, 0.59, 0, 0, 0, 132800203, 0, 132800203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1328003, "纏雷の障壁", 132800302, 132800308, 0, 0.0, 132800305, 0, "自分と召喚体以外の味方全体の残りＨＰを25％消費するが、味方全体の魔法攻撃力を中アップさせ、味方全体に物理/魔法無効バリアを展開する。さらに自分の魔法攻撃力を大アップさせ、ＴＰを小回復する。自分と召喚体以外の味方全体の残りＨＰが多いほど、このスキルの効果量が最大５倍までアップする。このスキルによる味方へのダメージでは味方のＴＰは回復しない。", 0, 0, 132800306, 132800304, 0, 0, 0, 0, 132800301, 2013, 132800307, 0.59, 0, 0, 132800309, 0, 0, 132800303);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1328501, "ラブ＆パニッシュメント", 0, 0, 0, 0.0, 0, 0, "バトル開始時に自分の魔法攻撃力を中アップさせる。", 0, 0, 0, 0, 0, 0, 0, 0, 132850101, 3003, 0, 0.0, 0, 0, 0, 0, 0, 0);
