INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1329001, "ラブリーデビルダイブ", 132900102, 0, 0, 0.0, 132900105, 0, "目の前の敵１キャラに魔法特大ダメージを与え、魔法防御力を中ダウンさせる。さらに、自分を中心とした範囲内の味方すべてのＨＰを中回復させ、物理/魔法吸収バリアを展開し、魔法防御力を大アップさせる。", 0, 0, 0, 132900104, 0, 0, 0, 0, 132900101, 1004, 0, 0.0, 132900101, 0, 0, 0, 0, 132900103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1329002, "スウィートハートプレゼント", 132900202, 132900208, 132900207, 0.0, 132900205, 0, "目の前の敵１キャラの魔法防御力を小ダウン、魔法攻撃力を大ダウンさせる。さらに【悪魔の口づけ】が付与されている味方の魔法攻撃力を特大アップ、魔法攻撃クリティカル時のダメージを小アップさせ、そのキャラを中心とした範囲内の味方すべての魔法攻撃力を大アップ、魔法攻撃クリティカル時のダメージを小アップさせる。", 0, 0, 132900206, 132900204, 0, 0, 0, 0, 132900201, 2004, 132900207, 1.05, 0, 132900207, 132900209, 0, 0, 132900203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1329003, "ハートフルキス", 132900302, 0, 0, 0.0, 132900305, 0, "【悪魔の口づけ】が付与されている味方のＨＰとＴＰを小回復させる。さらにそのキャラを中心とした範囲内の味方すべてのＨＰとＴＰを小回復させる。", 0, 0, 132900306, 132900304, 0, 0, 0, 132900305, 132900301, 2006, 132900307, 1.05, 0, 0, 0, 132900305, 0, 132900303);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1329101, "ハートフルキス", 132910102, 0, 0, 0.0, 132910105, 0, "自分以外の最も魔法攻撃力が高い味方１キャラに【悪魔の口づけ】を付与し、ＨＰとＴＰを小回復させる。さらにそのキャラを中心とした範囲内の味方すべてのＨＰとＴＰを小回復させる。", 0, 0, 132910106, 132910104, 0, 0, 132910104, 0, 132910101, 2006, 0, 1.05, 0, 0, 0, 132910104, 0, 132910103);
