INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1330001, "グレイテスト・スラスト", 133000102, 0, 0, 0.0, 133000105, 0, "目の前の敵１キャラに物理特大ダメージを与え、自分を中心とした範囲内の味方すべての物理攻撃力を特大アップさせ、行動速度を大アップさせる。さらに、自分に【レイスボディ】を３つ付与する。【レイスボディ】が付与されている間は敵からの攻撃の対象にならない。【レイスボディ】は最大３つまで追加される。", 0, 0, 0, 133000104, 0, 0, 0, 0, 133000101, 1001, 0, 0.0, 0, 0, 0, 0, 0, 133000103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1330002, "レイスドロップ", 133000202, 0, 0, 0.0, 133000205, 0, "目の前の敵１キャラに物理大ダメージを与え、自分を中心とした範囲内の味方すべての物理攻撃力を特大アップ、物理クリティカルを大アップさせる。自分に【レイスボディ】が付与されている場合、【レイスボディ】を１つ消費し、追加で目の前の敵１キャラに物理防御力を一定値無視する物理大ダメージを与える。", 0, 0, 133000206, 133000204, 0, 0, 0, 0, 133000201, 2001, 133000207, 0.59, 0, 0, 0, 0, 0, 133000203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1330003, "ファントム大車輪", 133000302, 0, 0, 0.0, 133000305, 0, "自分の物理攻撃力を大アップ、ＴＰを特大回復し、自分以外の味方全体のＴＰを中回復させる。自分に【レイスボディ】が付与されている場合、【レイスボディ】をすべて消費し、消費した【レイスボディ】の数に応じて物理攻撃力の上昇量がアップする。", 0, 0, 133000306, 133000304, 0, 0, 0, 0, 133000301, 2006, 0, 0.44, 0, 0, 0, 0, 0, 133000303);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1330501, "丑三つ時オーラ", 0, 0, 0, 0.0, 0, 0, "バトル開始時に自分の物理攻撃力を中アップさせる。", 0, 0, 0, 0, 0, 0, 0, 0, 133050101, 3001, 0, 0.0, 0, 0, 0, 0, 0, 0);
