INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1331001, "アブソルト・アケディア", 133100102, 133100108, 133100108, 0.0, 133100105, 0, "目の前の敵１キャラの物理防御力と魔法防御力を小ダウンさせる。【忌火】中、物理防御力と魔法防御力のダウン量がアップし、目の前の敵１キャラを絶怠霊度状態にして、さらに自分のＨＰを中回復する。絶怠霊度状態は、そのキャラの最大ＨＰに応じて最大444444の割合ダメージを継続して発生させる。", 0, 0, 133100106, 133100104, 0, 0, 0, 0, 133100101, 1008, 133100107, 0.0, 133100101, 0, 133100109, 0, 0, 133100103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1331002, "ソウルストリーム", 133100202, 133100208, 0, 0.0, 133100205, 0, "味方全体に物理/魔法無効バリアを展開し、物理防御力と魔法防御力を大アップさせる。さらに、目の前の敵１キャラの物理攻撃力と魔法攻撃力を大ダウンさせる。【忌火】中、味方全体のＨＰを中回復、ＴＰを小回復させ、目の前の敵１キャラにそのキャラの最大ＨＰに応じて最大444444の物理割合ダメージを与える。", 0, 133100210, 133100206, 133100204, 0, 0, 133100204, 0, 133100201, 2013, 133100207, 0.74, 0, 0, 133100209, 0, 0, 133100203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1331003, "イモータル・ステップ", 133100302, 0, 0, 0.0, 133100305, 0, "自分に【穢レ】を付与し、物理防御力と魔法防御力を小アップする。【穢レ】が付与されている間は敵から受ける特定のダメージの30％を継続ダメージに変換する。【忌火】中でない場合、このスキルの効果は発動しない。【穢レ】によって変換される継続ダメージでは味方のＴＰは回復しない。", 0, 0, 133100306, 133100304, 0, 0, 133100302, 0, 133100301, 2017, 0, 1.05, 0, 0, 0, 133100302, 0, 133100303);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1331101, "忌火の境界", 133110102, 0, 0, 0.0, 0, 0, "環境効果【忌火】を発動する。このスキルの効果は敵、味方すべてに適用される。継続ダメージを与える状態異常のダメージの発生間隔と効果時間が延長される。", 0, 0, 0, 0, 0, 0, 0, 0, 133110101, 2017, 0, 1.05, 133110101, 0, 0, 0, 0, 0);
