INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1332001, "絢爛廻天麗舞！", 133200102, 0, 0, 0.0, 133200105, 0, "目の前の敵１キャラを中心とした範囲内の敵すべてに物理大ダメージを与え、物理防御力を小ダウンさせる。さらに、自分の物理攻撃力を大アップする。このスキルで与えたダメージ量に応じて、防御力ダウンと攻撃力アップの効果量が最大５倍までアップする。", 133200102, 0, 133200106, 133200104, 0, 0, 0, 0, 133200101, 1001, 0, 0.0, 133200101, 0, 0, 0, 0, 133200103);
