INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1335001, "ライジングフェニックス", 133500102, 0, 0, 0.0, 133500105, 0, "目の前の敵１キャラに魔法特大ダメージを２回与え、自分の魔法攻撃力を特大アップする。このスキルのダメージは【火の鳥】の数に応じて増加する。", 0, 0, 0, 133500104, 0, 0, 0, 0, 133500101, 1002, 0, 0.0, 0, 0, 0, 0, 0, 133500103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1335002, "コーリングフェザー", 133500202, 133500208, 0, 0.0, 133500205, 0, "目の前の敵１キャラに魔法大ダメージを与え、魔法防御力を小ダウンさせる。さらに自分のＴＰを中回復する。【火の鳥】の数が10以上の場合、目の前の敵１キャラに追加の魔法大ダメージを与え、クリティカルを受けた際のダメージを小アップさせる。このスキルのダメージは【火の鳥】の数に応じて増加する。", 0, 0, 133500206, 133500204, 0, 0, 0, 133500205, 133500201, 2002, 133500207, 1.05, 133500201, 0, 133500209, 0, 0, 133500203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1335003, "メディテーションダンス", 133500302, 133500308, 0, 0.0, 133500305, 0, "バトル開始後、初弾のこのスキルは味方がＵＢを使用するたびに自分に【火の鳥】が１つ追加される状態にする。【火の鳥】は最大20まで追加される。味方全体の魔法攻撃力を特大アップ、魔法クリティカルを中アップさせ、ＴＰを中回復させる。この効果は自分に対してのみ効果量がアップする。", 0, 0, 133500306, 133500304, 0, 0, 0, 0, 133500301, 2003, 133500307, 1.05, 0, 0, 133500309, 0, 0, 133500303);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1335501, "ノーブルニューイヤー", 0, 0, 0, 0.0, 0, 0, "バトル開始時に自分の魔法攻撃力を中アップさせる。", 0, 0, 0, 0, 0, 0, 0, 0, 133550101, 3003, 0, 0.0, 0, 0, 0, 0, 0, 0);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1335511, "ノーブルニューイヤー+", 0, 0, 0, 0.0, 0, 0, "バトル開始時に自分の魔法攻撃力を大アップさせる。", 0, 0, 0, 0, 0, 0, 0, 0, 133551101, 3003, 0, 0.0, 0, 0, 0, 0, 0, 0);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1336001, "リーサル・メドゥシアナ", 133600102, 0, 0, 0.0, 133600105, 133600102, "目の前の敵１キャラを中心とした範囲内の敵すべてに物理特大ダメージを与え、物理防御力を中ダウンさせ、猛毒状態と石化状態にする。さらに、自分に【魔眼】を１つ付与する。【魔眼】は最大３つまで追加される。", 133600102, 0, 133600106, 133600104, 0, 0, 133600102, 0, 133600101, 1001, 0, 0.0, 133600101, 0, 0, 0, 0, 133600103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1336002, "イリュージョンウィップ", 133600202, 133600208, 0, 0.0, 133600205, 133600202, "目の前の敵１キャラを中心とした範囲内の敵すべてに物理大ダメージを与え、物理攻撃力と魔法攻撃力を大ダウン、物理防御力を小ダウンさせる。このスキルの効果量は【魔眼】の数に応じて上昇する。", 133600202, 0, 133600206, 133600204, 0, 0, 133600202, 0, 133600201, 2001, 133600207, 1.05, 133600201, 0, 133600209, 0, 0, 133600203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1336003, "マイティー・アイ", 133600302, 133600308, 0, 0.0, 133600305, 0, "味方全体の物理攻撃力を特大アップ、物理クリティカルを大アップ、物理攻撃クリティカル時のダメージを小アップさせる。さらに、自分のＴＰを小回復する。このスキルの効果量は【魔眼】の数に応じて上昇する。", 0, 0, 133600306, 133600304, 0, 0, 0, 0, 133600301, 2003, 133600307, 1.05, 0, 0, 0, 0, 0, 133600303);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1336501, "ゴルゴーンの威光", 0, 0, 0, 0.0, 0, 0, "バトル開始時に自分の物理攻撃力を中アップさせる。", 0, 0, 0, 0, 0, 0, 0, 0, 133650101, 3001, 0, 0.0, 0, 0, 0, 0, 0, 0);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1336511, "ゴルゴーンの威光+", 0, 0, 0, 0.0, 0, 0, "バトル開始時に自分の物理攻撃力を大アップさせる。", 0, 0, 0, 0, 0, 0, 0, 0, 133651101, 3001, 0, 0.0, 0, 0, 0, 0, 0, 0);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1337001, "バレット・ワールド", 133700102, 0, 0, 0.0, 133700105, 0, "目の前の敵１キャラに魔法大ダメージを３回与える。１回ごとにダメージがアップする。さらに、自分を中心に、魔法攻撃力を大アップさせるフィールドを展開する。フィールド上にいるキャラが水属性だった場合、追加で魔法攻撃力を大アップさせ、ＴＰ上昇を小アップさせる。", 0, 0, 133700106, 133700104, 0, 0, 0, 0, 133700101, 1002, 0, 0.0, 0, 0, 0, 0, 0, 133700103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1337002, "デコーデッドスナイプ", 133700202, 0, 0, 0.0, 133700205, 133700203, "目の前の敵１キャラに魔法中ダメージを与え、魔法防御力を小ダウンさせる。これを３回行い、１回ごとにダメージと魔法防御力ダウンの効果量がアップする。", 0, 0, 133700206, 133700204, 0, 0, 0, 0, 133700201, 2002, 0, 1.05, 133700201, 0, 0, 133700205, 0, 133700203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1337003, "リロードスクリプト", 133700302, 0, 0, 0.0, 133700305, 133700303, "自分の魔法攻撃力を大アップ、魔法攻撃クリティカル時のダメージを小アップし、ＴＰを小回復する。【フィールド展開中】このスキルの効果量がアップする。", 133700302, 0, 133700306, 133700304, 0, 0, 0, 133700306, 133700301, 2006, 133700307, 1.05, 0, 0, 0, 133700305, 0, 133700303);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1337501, "アームズクリエイション", 0, 0, 0, 0.0, 0, 0, "バトル開始時に自分の魔法攻撃力を中アップさせる。", 0, 0, 0, 0, 0, 0, 0, 0, 133750101, 3003, 0, 0.0, 0, 0, 0, 0, 0, 0);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1337511, "アームズクリエイション+", 0, 0, 0, 0.0, 0, 0, "バトル開始時に自分の魔法攻撃力を大アップさせる。", 0, 0, 0, 0, 0, 0, 0, 0, 133751101, 3003, 0, 0.0, 0, 0, 0, 0, 0, 0);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1338001, "ティル・ナ・ノーグ", 133800102, 133800108, 0, 0.0, 133800105, 133800102, "目の前の敵１キャラを中心とした範囲内の敵すべてに魔法大ダメージを与え、魔法防御力を小ダウン、クリティカルを受けた際のダメージを小アップさせる。ネネカ（アルファ）が召喚したグレゴールが味方にいる場合、グレゴールの魔法攻撃力に応じて与えるダメージがアップし、追加で敵全体の魔法防御力を小ダウンさせる。", 133800102, 0, 133800106, 133800104, 0, 0, 0, 0, 133800101, 1004, 133800107, 0.0, 133800101, 0, 0, 0, 0, 133800103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1338002, "ティターニアブライト", 133800202, 133800208, 0, 0.0, 133800205, 133800202, "目の前の敵１キャラを中心とした範囲内の敵すべてに魔法中ダメージを与え、魔法防御力を小ダウン、物理攻撃力と魔法攻撃力を大ダウンさせる。ネネカ（アルファ）が召喚したグレゴールが味方にいる場合、グレゴールの魔法攻撃力に応じて与えるダメージがアップし、追加で敵全体の魔法防御力を小ダウンさせる。", 133800202, 0, 133800206, 133800204, 0, 0, 133800202, 0, 133800201, 2004, 133800207, 1.05, 133800201, 0, 133800209, 0, 0, 133800203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1338003, "フォスフォレセント", 133800302, 133800308, 0, 0.0, 133800305, 0, "【召喚】自分を中心とした範囲内の味方すべての魔法攻撃力、魔法クリティカルを大アップ、魔法攻撃クリティカル時のダメージを小アップさせる。闇属性のキャラに対してはこの効果が２回発動する。さらに、ネネカ（アルファ）が召喚したグレゴールが味方にいる場合、グレゴールのＴＰを小回復させ、そうでない場合グレゴールを召喚する。", 0, 0, 133800306, 133800304, 0, 0, 0, 0, 133800301, 2017, 133800307, 1.05, 0, 0, 133800309, 0, 0, 133800303);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1338101, "グレゴリアライト", 133810102, 0, 0, 0.0, 133810105, 0, "グレゴール以外の味方すべてのＴＰ上昇を小アップさせ、ＴＰを小回復させる。さらにグレゴールのＴＰを全て消費し、消費した量に応じてグレゴール以外の闇属性の味方すべてのＴＰを回復する。", 0, 0, 0, 133810104, 0, 0, 0, 0, 133810101, 2006, 0, 1.0, 0, 0, 0, 0, 0, 133810103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1338102, "妖精の羽ばたき", 133810202, 133810208, 0, 0.0, 133810205, 0, "目の前の敵１キャラを中心とした範囲内の敵すべてに魔法大ダメージを与え、ＴＰを小ダウンさせ、グレゴールのＨＰとＴＰを小回復する。また、グレゴール以外の味方すべての魔法攻撃力と魔法クリティカルを大アップさせる。グレゴール以外の闇属性のキャラに対してはこの効果が２回発動する。", 133810202, 0, 133810206, 133810204, 0, 0, 0, 0, 133810201, 2002, 133810207, 1.0, 133810201, 0, 133810209, 0, 0, 133810203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1338501, "フェアリーサークル", 0, 0, 0, 0.0, 0, 0, "バトル開始時に自分の魔法クリティカルを中アップさせる。", 0, 0, 0, 0, 0, 0, 0, 0, 133850101, 3003, 0, 0.0, 0, 0, 0, 0, 0, 0);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1338511, "フェアリーサークル+", 0, 0, 0, 0.0, 0, 0, "バトル開始時に自分の魔法クリティカルを大アップさせる。", 0, 0, 0, 0, 0, 0, 0, 0, 133851101, 3003, 0, 0.0, 0, 0, 0, 0, 0, 0);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1339001, "虚数魔境", 133900102, 133900108, 0, 0.0, 133900105, 0, "自分の物理攻撃力を大アップし、敵全体に物理大ダメージを与え、物理防御力を小ダウンさせる。自分に【虚数】が付与されている場合、さらに最も物理防御力の低い敵１キャラに物理特大ダメージを与える。", 133900102, 0, 133900106, 133900104, 0, 0, 0, 0, 133900101, 1001, 133900107, 0.0, 0, 0, 0, 133900105, 0, 133900103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1339002, "デモニックスラスト", 133900202, 0, 0, 0.0, 133900205, 0, "前方の敵すべてに物理中ダメージを与える。自分に【虚数】が付与されている場合、さらに前方の敵の中で最も物理防御力の低い敵１キャラに物理大ダメージを与え、自分のＴＰを中回復する。", 0, 0, 133900206, 133900204, 0, 0, 0, 0, 133900201, 2001, 133900207, 1.05, 0, 0, 0, 0, 0, 133900203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1339003, "アブソリュート・ワン", 133900302, 0, 0, 0.0, 133900305, 0, "自分に【虚数】を付与し、物理攻撃力を特大アップ、物理攻撃クリティカル時のダメージとＴＰ上昇を小アップし、全ての物理攻撃を回避する。闇属性の味方の数に応じて物理攻撃力と物理攻撃クリティカル時のダメージの上昇量が最大４倍までアップする。【虚数】が付与されている間、このキャラのユニオンバーストとスキルのダメージは必ず命中し、クリティカルする。", 0, 0, 133900306, 133900304, 0, 0, 0, 0, 133900301, 2017, 133900307, 0.0, 0, 0, 0, 0, 0, 133900303);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1339501, "イニシャライズディアブロ", 0, 0, 0, 0.0, 0, 0, "バトル開始時に自分の物理攻撃力を中アップさせる。", 0, 0, 0, 0, 0, 0, 0, 0, 133950101, 3001, 0, 0.0, 0, 0, 0, 0, 0, 0);
