INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1340001, "フィオレ・フェリチータ", 134000102, 0, 0, 0.0, 0, 0, "味方全体の物理防御力と魔法防御力を大アップさせ、継続ＨＰ回復状態を付与し、物理/魔法無効バリアを展開する。", 0, 0, 0, 134000104, 0, 0, 0, 0, 134000101, 1003, 0, 0.0, 0, 0, 0, 0, 0, 134000103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1340002, "ルーチェ・プロデューレ", 134000202, 0, 0, 0.0, 134000205, 134000203, "バリアが展開されている味方すべてに物理ダメージカット効果と魔法ダメージカット効果を付与する。さらに、風属性の味方すべてのＨＰを中回復させ、行動速度を大アップさせる。", 134000202, 0, 134000206, 134000204, 0, 0, 0, 0, 134000201, 2003, 0, 1.05, 134000201, 0, 0, 0, 0, 134000203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1340003, "ファータ・パルピト", 134000302, 134000308, 134000306, 0.0, 134000305, 134000302, "味方全体の物理攻撃力と魔法攻撃力を大アップ、物理攻撃クリティカル時のダメージと魔法攻撃クリティカル時のダメージを小アップさせる。この効果はバリアが展開されている味方に対して効果量がアップする。さらに、風属性の味方すべてのＴＰを中回復させる。", 134000302, 134000310, 134000306, 134000304, 0, 0, 134000302, 134000306, 134000301, 2003, 134000307, 1.05, 134000301, 134000306, 134000309, 134000301, 0, 134000303);
