INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1343002, "メロディックブリーズ", 134300202, 134300208, 0, 0.0, 134300205, 134300202, "最も魔法防御力の低い敵１キャラを中心とした範囲内の敵すべてに魔法大ダメージを与え、魔法攻撃力を中ダウン、魔法防御力を小ダウンさせ、クリティカルを受けた際のダメージを小アップさせる。さらに追加の魔法大ダメージを与える。このスキルのダメージは範囲内の敵の数に応じて減少する。", 134300202, 0, 134300206, 134300204, 0, 0, 134300202, 134300201, 134300201, 2002, 134300207, 1.05, 134300201, 134300201, 0, 134300201, 0, 134300203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1343003, "ハーモニックサークル", 134300302, 0, 0, 0.0, 134300305, 0, "味方全体の魔法防御力を大アップさせる。さらに、自分を中心とした範囲内の味方すべての魔法攻撃力を特大アップさせ、魔法無効バリアを展開する。自分以外の最も近くの味方１キャラの魔法攻撃力に応じて魔法攻撃力アップの上昇量、バリアの無効ダメージ量が最大２倍までアップする。", 0, 0, 0, 134300304, 0, 0, 0, 0, 134300301, 2003, 0, 1.05, 0, 0, 0, 0, 0, 134300303);
