INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1344001, "エメラルドシンフォニー", 134400102, 0, 0, 0.0, 134400105, 0, "味方全体の魔法攻撃力を特大アップ、魔法クリティカルを大アップさせる。さらに、自分と最も近くの味方１キャラの魔法攻撃力と魔法クリティカルを特大アップ、魔法クリダメを小アップさせ、敵全体に魔法大ダメージを与え、味方全体のＨＰを小回復させる。", 0, 0, 134400106, 134400104, 0, 0, 0, 0, 134400101, 1003, 134400107, 0.0, 0, 0, 0, 0, 0, 134400103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1344002, "サンクトゥスコーラス", 134400202, 0, 0, 0.0, 0, 0, "味方全体の魔法攻撃力を特大アップさせ、物理無効バリアを展開する。さらに、自分と最も近くの味方１キャラの魔法攻撃力を特大アップさせ、ＴＰを中回復させる。", 0, 0, 0, 134400204, 0, 0, 0, 0, 134400201, 2006, 0, 0.74, 0, 0, 0, 0, 0, 134400203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1344003, "シルフェンカンタービレ", 134400302, 0, 0, 0.0, 134400305, 0, "味方全体の物理防御力を大アップさせる。さらに、自分と最も近くの味方１キャラの魔法攻撃力と魔法クリティカルを特大アップ、魔法クリダメを小アップ、ＴＰ上昇を小アップさせる。", 0, 0, 0, 134400304, 0, 0, 0, 0, 134400301, 2003, 0, 0.74, 0, 0, 0, 0, 0, 134400303);
