INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1345001, "エアリアルブラストーム", 134500102, 0, 0, 0.0, 0, 134500103, "味方全体の魔法攻撃力と魔法クリティカルを特大アップさせ、目の前の敵１キャラに魔法特大ダメージを与え、魔法防御力を小ダウンさせる。このスキルは１ヒットは必ずクリティカルし、クリティカルした場合のダメージは、２倍ではなく３倍になる。", 0, 0, 0, 134500104, 0, 0, 0, 0, 134500101, 1003, 0, 0.0, 0, 0, 0, 0, 0, 134500103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1345002, "クロスピンボルト", 134500202, 134500208, 134500208, 0.0, 134500205, 0, "敵全体の物理攻撃力と魔法攻撃力を大ダウン、魔法防御力を小ダウン、クリティカルを受けた際のダメージを小アップさせ、行動速度を大ダウンさせる。さらに、自分のＴＰを小回復する。自分にバリアが展開されている場合、自分のバリアを全て解除し、ＨＰとＴＰを小回復する。", 0, 134500210, 134500206, 134500204, 0, 134500208, 0, 0, 134500201, 2004, 134500207, 1.05, 0, 0, 134500209, 0, 0, 134500203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1345003, "エアリアルバリア", 134500302, 134500308, 134500308, 0.0, 134500305, 0, "味方全体の魔法攻撃力を特大アップ、物理防御力と魔法防御力を大アップ、魔法攻撃クリティカル時のダメージを小アップさせ、行動速度を大アップさせる。さらに、自分のＴＰを小回復する。自分にバリアが展開されている場合、自分のバリアを全て解除し、ＨＰとＴＰを小回復する。", 0, 134500310, 134500306, 134500304, 0, 134500308, 0, 0, 134500301, 2003, 134500307, 1.05, 0, 0, 134500309, 0, 0, 134500303);
