INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1346001, "ギガンティックキャノン発射！", 134600102, 0, 0, 0.0, 134600105, 0, "自分の物理攻撃力を特大アップし、目の前の敵１キャラに物理特大ダメージを与える。さらに目の前の敵１キャラを中心に、物理ダメージフィールドと、物理攻撃力を大ダウン、物理防御力を特大ダウンさせるフィールドを展開する。", 0, 0, 0, 134600104, 0, 0, 0, 0, 134600101, 1001, 0, 0.0, 0, 0, 0, 0, 0, 134600103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1346002, "クロースぼっちコンバット", 134600202, 134600208, 0, 0.0, 134600205, 134600203, "目の前の敵１キャラに物理大ダメージを与える。さらにそのキャラを中心とした範囲内の敵すべてに物理中ダメージを与え、物理攻撃力を中ダウン、物理防御力を小ダウンさせる。【フィールド展開中】このスキルのダメージがアップし、目の前の敵１キャラを中心とした範囲内の敵すべてのクリティカルを受けた際のダメージを小アップさせる。", 134600202, 134600210, 134600206, 134600204, 0, 134600202, 134600203, 0, 134600201, 2001, 134600207, 1.05, 0, 134600207, 134600209, 0, 0, 134600203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1346003, "ピンポイントぼっちバリア", 134600302, 134600308, 0, 0.0, 134600305, 0, "自分に物理無効バリアを展開し、さらに自分の物理攻撃力を特大アップ、ＴＰ上昇を小アップし、ＴＰを中回復する。【フィールド展開中】味方全体に物理/魔法吸収バリアを展開し、さらに味方全体の物理攻撃力を特大アップ、ＴＰを小回復させる。", 0, 0, 134600306, 134600304, 0, 0, 0, 134600306, 134600301, 2013, 134600307, 1.05, 0, 134600306, 0, 0, 0, 134600303);
