INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1347001, "五色絢爛の浄炎", 134700102, 134700108, 0, 0.0, 134700105, 0, "物理攻撃を行う味方の物防、魔防中アップ、物魔吸収バリア展開、物理・魔法ダメージカット付与、物攻大アップ、物理クリダメ小アップ。目の前の敵１キャラに物理中ダメージを与える。物攻の上昇量とダメージ倍率は、自分を除く味方の残りＨＰに応じて最大５倍までアップ。", 0, 134700110, 134700106, 134700104, 0, 0, 0, 0, 134700101, 1003, 134700107, 0.0, 0, 0, 134700109, 0, 0, 134700103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1347002, "リカバリーオブフェニクス", 134700202, 0, 0, 0.0, 134700205, 0, "物理攻撃を行うすべての味方キャラの物理攻撃力を中アップ、ＨＰ吸収を小アップさせる。自分を中心とした範囲内の味方すべてのＨＰを小回復するフィールドを展開する。さらに、火属性の味方すべてのＨＰを小回復させ、継続ＨＰ回復状態を付与する。物理攻撃力の上昇量は、自分を除く味方の残りＨＰに応じて最大５倍までアップする。", 0, 0, 134700206, 134700204, 0, 0, 0, 0, 134700201, 2005, 134700207, 0.59, 0, 0, 0, 0, 0, 134700203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1347003, "鳳凰の庭炎", 134700302, 0, 0, 0.0, 134700305, 0, "物理攻撃を行うすべての味方キャラの物理攻撃力を中アップ、ＴＰ上昇を小アップさせる。自分を中心とした範囲内の味方すべてのＴＰを小回復するフィールドを展開する。さらに、火属性の味方すべてのＴＰを小回復させ、継続ＴＰ回復状態を付与する。物理攻撃力の上昇量は、自分を除く味方の残りＨＰに応じて最大５倍までアップする。", 0, 0, 134700306, 134700304, 0, 0, 0, 0, 134700301, 2006, 0, 0.59, 0, 0, 0, 0, 0, 134700303);
