INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1348002, "テーラードブースト", 134800202, 0, 0, 0.0, 134800205, 0, "自分以外の最も物理攻撃力が高い味方１キャラの行動速度を大アップ、物理攻撃力を特大アップさせ、ＴＰを小回復させる。（このスキルの効果は他の行動速度変化スキルと重複する）さらに、味方全体の物理攻撃力と物理クリティカルを大アップさせる。", 0, 0, 134800206, 134800204, 0, 0, 0, 0, 134800201, 2003, 0, 1.05, 0, 0, 0, 0, 0, 134800203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1348003, "エンハンスフルーツ", 134800302, 0, 0, 0.0, 134800305, 0, "自分以外の最も物理攻撃力が高い味方１キャラの物理攻撃力を特大アップさせ、ＴＰを小回復させる。さらに、味方全体の物理攻撃力を大アップ、魔法防御力を中アップ、魔法無効バリアを展開し、ＨＰを中回復、ＴＰを小回復させる。", 0, 0, 134800306, 134800304, 0, 0, 0, 0, 134800301, 2005, 134800307, 0.74, 0, 0, 0, 0, 0, 134800303);
