INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1349001, "マンティコア流操霊術・ハイドラカノン", 134900102, 134900108, 134900108, 0.0, 134900105, 0, "目の前の敵１キャラに物理極大ダメージを与え、魔法攻撃力を大ダウン、物理防御力を中ダウンさせる。さらに、自分の物理攻撃力と物理クリティカルを特大アップするが、自分の最大ＨＰの10％を消費する。このスキルによる自分へのダメージでは自分のＴＰは回復しない。自分に【お堪忍袋】が付与されている場合、【お堪忍袋】を１つ消費して自分の物理攻撃力を特大アップする。", 134900101, 0, 134900106, 134900104, 0, 0, 0, 0, 134900101, 1001, 134900107, 0.0, 134900101, 0, 134900109, 0, 0, 134900103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1349002, "毒殺剣術・お滅多突き", 134900202, 0, 0, 0.0, 134900205, 0, "目の前の敵１キャラに物理大ダメージを与え、魔法攻撃力を中ダウン、物理防御力を小ダウンさせる。さらに、自分に【お堪忍袋】が付与されていない場合、追加の物理大ダメージを与え、自分のＨＰを小回復する。", 134900201, 0, 134900206, 134900204, 0, 0, 0, 0, 134900201, 2001, 134900207, 0.34, 134900201, 0, 0, 0, 0, 134900203);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1349003, "ぶっ飛ばしおスラッシュ", 134900302, 134900308, 0, 0.0, 134900305, 0, "目の前の敵１キャラに物理大ダメージを与える。さらに、自分に【お堪忍袋】が付与されていない場合、目の前の敵１キャラに追加の物理大ダメージを与え、行動パターンが変化し、自分の物理攻撃力を特大アップ、ＨＰを小回復、ＴＰを特大回復する。", 0, 0, 134900306, 134900304, 0, 0, 134900304, 134900306, 134900301, 2001, 134900307, 0.59, 0, 0, 0, 134900305, 0, 134900303);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1349101, "ヲ～ッホッホッ♪", 134910102, 0, 0, 0.0, 0, 134910103, "自分に【お堪忍袋】を２つ付与する。【お堪忍袋】は敵から攻撃を受けると１つ減少し、自分の物理攻撃力を特大アップする。【お堪忍袋】は最大２つまで追加される。", 134910104, 0, 0, 134910104, 0, 0, 0, 0, 134910101, 2017, 0, 0.74, 0, 0, 0, 0, 0, 134910103);
