INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1913001, "海の漢の一擲", 191300102, 0, 0, 0.0, 191300105, 191300103, "自身のＨＰが50%より多い場合、敵に強力なスタンを付与し、さらに物理・魔法防御力を特大ダウンさせる。自身のＨＰが50%以下の場合、味方全体の物理・魔法攻撃力を大アップさせる。", 0, 0, 191300106, 191300104, 0, 0, 191300103, 191300106, 191300101, 1001, 191300107, 0.0, 0, 0, 0, 0, 0, 191300103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1915002, "", 191500202, 0, 0, 0.0, 0, 0, "このキャラクターはユニオンバーストを発動しない。", 0, 0, 0, 0, 0, 0, 0, 0, 191500201, 1001, 0, 0.0, 0, 0, 0, 0, 0, 0);
