INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1927001, "廻舞・姫銀氷竜", 192700102, 192700108, 0, 0.0, 192700105, 192700102, "※煉獄のリベリオン専用スキル。目の前の敵１キャラに物理防御力を一定値無視する物理極大ダメージを２回与える。", 192700101, 0, 192700106, 192700104, 0, 0, 192700101, 0, 192700101, 1001, 192700107, 0.0, 0, 0, 0, 192700102, 0, 192700103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 1927002, "", 192700202, 0, 0, 0.0, 192700205, 0, "※煉獄のリベリオン専用スキル。自身の物理攻撃力、物理防御力、魔法防御力、物理クリティカルを特大アップさせる。さらに、物理攻撃クリティカル時のダメージを中アップさせ、ＴＰを毎秒小回復させる。", 0, 0, 192700206, 192700204, 0, 0, 0, 0, 192700201, 1001, 0, 0.0, 0, 0, 0, 0, 0, 192700203);
