INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 2067001, "", 206700102, 0, 0, 0.0, 0, 0, "目の前の敵１キャラに物理大ダメージを与え、その周りの狭い範囲の敵すべてにも物理中ダメージを与える。", 0, 0, 0, 0, 0, 0, 0, 0, 206700101, 1001, 0, 0.0, 206700102, 0, 0, 0, 0, 206700103);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 2067002, "", 0, 0, 0, 0.0, 0, 0, "目の前の敵１キャラに物理中ダメージを与える。", 0, 0, 0, 0, 0, 0, 0, 0, 206700201, 1001, 0, 1.125, 0, 0, 0, 0, 0, 0);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 2067003, "", 206700302, 0, 0, 0.0, 0, 0, "目の前の敵１キャラに物理小ダメージを与え、さらに自分の物理攻撃力を中アップさせる。", 0, 0, 0, 0, 0, 0, 0, 0, 206700301, 1001, 0, 1.295, 0, 0, 0, 0, 0, 0);
INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 2067011, "", 206701102, 0, 0, 0.0, 0, 0, "敵全体に物理ダメージを与え、さらにスタンさせる。", 0, 0, 0, 0, 0, 0, 0, 0, 206701101, 1001, 0, 0.0, 206701101, 0, 0, 0, 0, 0);
