INSERT INTO `v1_c40307468aff359e856c099c3c95aa8c6e8892033244edd990d3015941323dc3` VALUES (0, 4338012, "グレゴリアライト", 433801202, 0, 0, 0.0, 433801205, 0, "グレゴール以外の味方すべてのＴＰ上昇を小アップさせ、ＴＰを小回復させる。さらにグレゴールのＴＰを全て消費し、消費した量に応じてグレゴール以外の闇属性の味方すべてのＴＰを回復する。", 0, 0, 0, 433801204, 0, 0, 0, 0, 433801201, 2006, 0, 1.0, 0, 0, 0, 0, 0, 433801203);
